def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:

    self._check_method(method)

    if self.is_overlapping:
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    target_as_index = ensure_index(target)

    if isinstance(target_as_index, IntervalIndex):
        indexer = np.full(len(target_as_index), -1, dtype=np.intp)  # Initialize indexer with -1
        for i, interval in enumerate(target_as_index):
            try:
                loc = self.get_loc(interval)
                indexer[i] = loc
            except KeyError:
                continue
    else:
        target_as_index = ensure_index(target_as_index)
        indexer = target_as_index.get_indexer(self)

    return indexer
